import { Link } from "react-router-dom";



export default function Card({ image, name, diets }) {
    return(
        <div>
            <img src={image}/>
            <h1>Nombre: {name}</h1>
            <h2>Dietas: {diets?.join("/n")}</h2>
        </div>
    )
}
